//     x1, cs_prev, h_prev, w, wci, wcf, wco, b)
//   cs_prev = cs1
//   h_prev = h1
//   i.append(i1)
//   cs.append(cs1)
//   f.append(f1)
//   o.append(o1)
//   ci.append(ci1)
//   co.append(co1)
//   h.append(h1)
// return pack(i), pack(cs), pack(f), pack(o), pack(ci), pack(ch), pack(h)
