// lower triangular factor `L` with unit diagonal, and whose upper triangular part
// denotes the upper triangular factor `U`.
//	p: Permutation of the rows encoded as a list of indices in `0..M-1`. Shape is
// `[..., M]`.
// @compatibility(scipy)
